Alright this was an old project I had.
It is essentially the original PI with all of the following removed:
Skills
Minigames
Python Scripting (Sanity had it disabled)
Event Manager removed (Sanity didn't even use it)

Features:
Packets Handled via a switch statement now like original winterlove.
Total Java files reduced from 133 to 33.
Saving and Loading rewritten.
Removed Mina Networking and re-added io.

