The down low: This is just a clean base I decided to release with near perfect combat. If you know of any tut's to fix any dupes in normal PI post the links on this thread and I will either update this source, or tell you how to fix them.

Hopefully this can help convert some people that are borderline. I am not planning on continuing this. If you even bothered reading this far, then all I can tell you is that compared to normal PI this is crud, but that was never my intent. My intent was merely to spend some time and just try to make a clean base that is comparable to delta (but with better combat and no content). People talk daily about wanting a blank delta source, and here there is a source that Is much like delta and normal winterlove. It has io, it has thread per client, but unlike normal winterlove it does have pretty amazing combat. If i get bored I may do some tutorials on dupe fixes, but this is not my project.

